CREATE TABLE `patient` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `created_by` varchar(50) NOT NULL,
  `created_date` datetime NOT NULL,
  `last_modified_by` varchar(50) DEFAULT NULL,
  `last_modified_date` datetime DEFAULT NULL,
  `bilan_checked` bit(1) NOT NULL,
  `birth_day` date NOT NULL,
  `birth_place` varchar(255) DEFAULT NULL,
  `consulte` bit(1) NOT NULL,
  `cvd_risk` varchar(255) DEFAULT NULL,
  `date_first_bilan` date DEFAULT NULL,
  `date_last_bilan` date DEFAULT NULL,
  `date_last_consultation` date DEFAULT NULL,
  `date_last_define_target` date DEFAULT NULL,
  `date_next_consultation` date DEFAULT NULL,
  `define_target` bit(1) NOT NULL,
  `diabetes_family` bit(1) NOT NULL,
  `diabetique` bit(1) NOT NULL,
  `diagnostic_hypertension` bit(1) NOT NULL,
  `diagnostic_prescription_medicale` bit(1) NOT NULL,
  `district` varchar(255) DEFAULT NULL,
  `drink_alcohol` bit(1) NOT NULL,
  `education` int(11) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `first_name` varchar(255) DEFAULT NULL,
  `frequency_drink_alcohol` varchar(255) DEFAULT NULL,
  `frequency_smoke_cigarettes` varchar(255) DEFAULT NULL,
  `gender` int(11) NOT NULL,
  `heart_attack` bit(1) NOT NULL,
  `heart_cardiac_family` bit(1) NOT NULL,
  `height` int(11) DEFAULT NULL,
  `hypertension` bit(1) NOT NULL,
  `hypertension_family` bit(1) NOT NULL,
  `job` varchar(255) DEFAULT NULL,
  `last_doctor_visit` varchar(255) DEFAULT NULL,
  `last_name` varchar(255) NOT NULL,
  `pa_diastolique` int(11) DEFAULT NULL,
  `pa_systolique` int(11) DEFAULT NULL,
  `pregnant` bit(1) NOT NULL,
  `recommandation_frequence_program_suvi` int(11) DEFAULT NULL,
  `recommandationlifesytle_advice` bit(1) NOT NULL,
  `smoker` bit(1) NOT NULL,
  `statut_marital` int(11) DEFAULT NULL,
  `stroke` bit(1) NOT NULL,
  `telephone` varchar(255) DEFAULT NULL,
  `town` varchar(255) DEFAULT NULL,
  `weight` float DEFAULT NULL,
  `chw_id` bigint(20) NOT NULL,
  `recommandation_visit_doctor` varchar(255) DEFAULT NULL,
  `monitoring_treatment` bit(1) NOT NULL,
  `bloodpressure_mesured` bit(1) NOT NULL,
  `bloodpressure_tomesure` bit(1) NOT NULL,
  `bloodpressure_treatment` bit(1) NOT NULL,
  `date_last_bloodpressure_mesured` date DEFAULT NULL,
  `date_next_bloodpressure_mesure` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKsqpp965d5d9gfgy8jong4o703` (`chw_id`),
  CONSTRAINT `FKsqpp965d5d9gfgy8jong4o703` FOREIGN KEY (`chw_id`) REFERENCES `chw` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=47 DEFAULT CHARSET=latin1;
